import React from 'react';

const PostsList = (props) => {

    const posts = props.posts.map((post) => {
        return(
            <div key={post._id}>
                <p>{post.title}<br/>
                   {post.commentBody}
                   <button onClick={props.deletePost.bind(null, post._id)}>delete</button>
                   <button onClick={props.openModalAndEdit.bind(null, post._id)}>Edit</button>
                </p>

            </div>

        )

    })


    const EpisodesList = (props) => {
        const episodes = props.episodes.map((episode)=>{
           return( <EpisodeDetail key={episode._id} episode={episode} deleteEpisode={props.deleteEpisode}/>)
        })
        return(
            <div>
            {episodes}
            </div>
        )
    }

    return(
        <div>
           {posts}
        </div>
    )
}

export default PostsList;
